// src/components/MainMenu.js
import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Componennts/men';  // Correct import for SCSS module

const MainMenu = () => {
  return (
    <div className={styles.menuBar}>
      <ul>
        <li><Link to="/polymers">Polymers</Link></li>
        <li><Link to="/coating">Coating</Link></li>
        <li><Link to="/oil">Oil</Link></li>
        <li><Link to="/batteries">Batteries</Link></li>
      </ul>
    </div>
  );
}

export default MainMenu;
